text:
在 前后 端 分离 已经 不 适用 了 
这次 把 经常 用到 的 东西 整理出来 放到 这里 
get 请求 
/ /   为 给定   ID   的   user   创建 请求 
axios . get ( ' / user ? ID = 12345 ' ) 
  . then ( function   ( response )   { 
  console . log ( response ) ; 
  } ) 
  . catch ( function   ( error )   { 
  console . log ( error ) ; 
  } ) ; 
/ /   此处 then 方法 也 可以 写为 . 
axios . get ( ' / user ? ID = 12345 ' ) 
  . then ( res   = >   { 
  console . log ( ' 数据 是 : ' ,   res ) ; 
  } ) 
  . catch ( function   ( error )   { 
  console . log ( error ) ; 
  } ) ; 

/ /   上面 的 请求 也 可以 这样 做 
axios . get ( ' / user ' ,   { 
  params :   { 
  ID :   12345 
  } 
  } ) 
  . then ( function   ( response )   { 
  console . log ( response ) ; 
  } ) 
  . catch ( function   ( error )   { 
  console . log ( error ) ; 
  } ) ; 
post 请求 
xios . post ( ' / user ' ,   { 
  firstName :   ' Fred ' , 
  lastName :   ' Flintstone ' 
  } ) 
  . then ( function   ( response )   { 
  console . log ( response ) ; 
  } ) 
  . catch ( function   ( error )   { 
  console . log ( error ) ; 
  } ) ; 
注意 . 此处 请求 与 jQuery 完全 不同 . 
jQuery 如果 按照 此处 直接 传 json 对象 的 参数 的话 . 后台 应该 使用 request . getParameter 方式 接收 .

也就是说 默认 为 表单 提交 类型 . 即 application / x - www - form - urlencoded . 如果 是 对象 . 后台 springmvc 中 直接 使用 对象 接收 即可 . 
axios 如果 直接 传 json 对象 . 默认 认为 是 json 格式 传参 . 即 application / json . 也 就是 以流 的 形式 提交 . 后台 必须 使用 @ RequestBody 方式 接收 参数 . 
如果 想 使用 普通 的 post 传参 . 有 两种 方式 . 
/ /   1 . 使用 ? 号 
axios . post ( " http : / / localhost : 8080 / add ? id = 3 & name = mary & sex = n " ) . then ( function ( resp ) { 
	 if ( resp . data . code   = =   " 10000 " ) { 
	 alert ( JSON . stringify ( resp . data . data ) ) ; 
	 } else { 
	 alert ( resp . data . desc ) ; 
	 } 

	 } ) ; 
/ /   使用 params 
/ /   如果 使用 普通 的 post 传参 .

需要 使用 第三个 参数 才能 用 params 的 方式 
	 axios . post ( " http : / / localhost : 8080 / add " ,   null ,   { 
	 params : { 
	 id : 2 , 
	 name : " 张三 " , 
	 sex : " 男 " 
	 } 
	 } ) . then ( function ( resp ) { 
	 if ( resp . data . code   = =   " 10000 " ) { 
	 alert ( JSON . stringify ( resp . data . data ) ) ; 
	 } else { 
	 alert ( resp . data . desc ) ; 
	 } 
	 } ) ; 
并发 请求 
/ /   执行 多个 并发 请求 
function   getUserAccount ( )   { 
  return   axios . get ( ' / user / 12345 ' ) ; 
} 
function   getUserPermissions ( )   { 
  return   axios . get ( ' / user / 12345 / permissions ' ) ; 
} 
axios . all ( [ getUserAccount ( ) ,   getUserPermissions ( ) ] ) 
  . then ( axios . spread ( function   ( acct ,   perms )   { 
  / /   两个 请求 现在 都 执行 完成 
  } ) ) ; 
同时 进行 多个 请求 . 并 统一 处理 返回值 
axios . all ( iterable ) 
axios . spread ( callback ) 
例 . 
axios . all ( [ 
  axios . post ( ' / add ' , { name : ' wq ' , age : 20 } ) , 
  axios . detete ( ' / delete ' , { id : 1 } ) 
] ) . then ( axios . spread ( ( add ,   del )   = >   { 
  console . log ( add ,   del ) ; 
axios 的 参数 配置 
axios ( { 
  method :   ' get ' ,   / /   post . get . put .... 
  baseURL :   ' ' ,   / /   请求 的 域名 . 基本 地址 .
